import React, { useState, useEffect } from 'react'
import { Tabs} from 'antd';
import SmartVoice from './SmartVoice';

const { TabPane } = Tabs;

const Transaction = () => {

	return (
		<div>
			<Tabs defaultActiveKey="1" type="card" size='large'>
          		<TabPane tab="smartVoice" key="1">
            		<SmartVoice />
				</TabPane>
				<TabPane tab="smartText" key="2">
					Content of card tab 2
				</TabPane>
				<TabPane tab="smartEmail" key="3">
					Content of card tab 3
				</TabPane>
			</Tabs>
		</div>
	)
}

export default Transaction
